export enum PieceColor {
    White = 'white',
    Black = 'black',
}

export enum Outcome {
    White = 'white',
    Black = 'black',
    Draw = 'draw',
}

export enum GameOverResultText {
    Win = 'Congratulations, you won!',
    Lose = 'Agent won, good luck next time!',
    Draw = 'Draw, it was close!',
}
